body:
Not exactly sure what's the status of batch size support. but this commits address the key issues of converting paddle shapes to onnx shape using the `'?'` string for the unknown dimension.

It also address the dynamic reshaping for the `elementwise_ops`.

Note that this work is only preliminary as many ops need to be reviewed for proper support of unknown shapes.

My manual test exporting the ERNIE model to ONNX and then convert to tensorflow using `onnx-tensorflow`:

```python
with persisted_sess.as_default():
    with gfile.FastGFile("./ERNIE-en-base.tf-1.15-graph.pb",'rb') as f:
        graph_def = tf.GraphDef()
        graph_def.ParseFromString(f.read())
        persisted_sess.graph.as_default()
        tf.import_graph_def(graph_def, name='')
        print(persisted_sess.graph.get_name_scope())
        for i, op in enumerate(persisted_sess.graph.get_operations()):
            if op.type == 'Placeholder':
                print(op)

    def run_model(session, token_ids, text_type_ids, position_ids, task_ids, input_mask):
        return session.run(
            [ernie_classification_tensor, ernie_sequence_tensor], 
            feed_dict={
                src_ids_node: token_ids,
                sent_ids_node: text_type_ids,
                pos_ids_node: position_ids,
                task_ids_node: task_ids,
                input_mask_node: input_mask})

    batch_size = 32
    token_ids2 = np.squeeze(np.stack([token_ids] * batch_size, axis=0), axis=1)
    text_type_ids2 = np.squeeze(np.stack([text_type_ids] * batch_size, axis=0), axis=1)
    position_ids2 = np.squeeze(np.stack([position_ids] * batch_size, axis=0), axis=1)
    task_ids2 = np.squeeze(np.stack([task_ids] * batch_size, axis=0), axis=1)
    input_mask2 = np.squeeze(np.stack([input_mask] * batch_size, axis=0), axis=1)
    ernie_classification_latent, ernie_sequence_latent = run_model(persisted_sess, 
           token_ids2, text_type_ids2, position_ids2, task_ids2, input_mask2)
    print(ernie_classification_latent.shape, ernie_sequence_latent.shape)
```
