支持编译Paddle2ONNX静态库，修复Paddle2ONNX静态库无法使用的问题

- [x] linux
- [x] mac osx 
- [ ] windows(TODO) 

1. 编译命令，准备好protobuf后
```bash
git clone https://github.com/DefTruth/Paddle2ONNX.git -b add_paddle2onnx_use_mappers
cd Paddle2ONNX && mkdir build && cd build
cmake .. -DCMAKE_INSTALL_PREFIX=${PWD}/paddle2onnx-linux-x64 -DPYTHON_EXECUTABLE=`which python3.7` -DWITH_STATIC=ON
make -j8
make install
```  

2. 用法:  正常使用即可，无需额外设置
```c++
#include <fstream>
#include <iostream>
#include "paddle2onnx/converter.h"

int main(int argc, char* argv[]) {
  if (argc == 1) {
    std::cerr << "Paddle2ONNX Usage(params_file_path and onnx_model_save_path "
                 "is optional):   "
              << "    ./p2o_exec model_file_path  params_file_path  "
                 "onnx_model_save_path"
              << std::endl;
  }
  char* onnx_model;
  int out_size;
  std::string onnx_model_save_path = "model.onnx";
  if (argc == 2) {
    std::string paddle_model_path = argv[1];
    if (!paddle2onnx::Export(paddle_model_path.c_str(), "", &onnx_model,
                             &out_size)) {
      std::cerr << "Model convert failed." << std::endl;
      return -1;
    }
  } else if (argc == 3) {
    std::string paddle_model_path = argv[1];
    std::string params_file_path = argv[2];
    if (!paddle2onnx::Export(paddle_model_path.c_str(),
                             params_file_path.c_str(), &onnx_model,
                             &out_size)) {
      std::cerr << "Model converte failed." << std::endl;
      return -1;
    }
  } else if (argc == 4) {
    std::string paddle_model_path = argv[1];
    std::string params_file_path = argv[2];
    std::string onnx_model_save_path = argv[3];
    if (!paddle2onnx::Export(paddle_model_path.c_str(),
                             params_file_path.c_str(), &onnx_model,
                             &out_size)) {
      std::cerr << "Model converte failed." << std::endl;
      return -1;
    }
  }
  std::string onnx_proto(onnx_model, onnx_model + out_size);
  std::fstream out(onnx_model_save_path, std::ios::out | std::ios::binary);
  out << onnx_proto;
  out.close();

  return 0;
}

```
5. 使用静态库的cmake配置
```cmake
project(p2o_exec)
cmake_minimum_required(VERSION 3.16)
set(CMAKE_CXX_FLAGS "${CMAKE_CXX_FLAGS} -std=c++11")

set(paddle2onnx_install_path "paddle2onnx-linux-x64")
find_library(paddle2onnx_lib NAMES paddle2onnx_static PATHS ${paddle2onnx_install_path}/lib/)

add_executable(${PROJECT_NAME} cpp_export.cpp )
include_directories(${paddle2onnx_install_path}/include)

TARGET_LINK_LIBRARIES(${PROJECT_NAME} ${paddle2onnx_lib})
```
